import React, { useState } from 'react';

// import children components
import TiktokOrgPost from './TiktokOrgPost';

//import database
import { tiktok_info } from "../data/tiktok";


const Tiktok = (props) => {

  return (
    <div className='tiktok-wrapper'>
        <h1>{props.social_media_name}</h1>

        <section>

            <h2>{props.social_media_name} Organizer</h2>

            {tiktok_info.map((item, index) => {
              return <TiktokOrgPost title={item.title} audio={item.audio} script={item.script} key={index}/>;
            })}

        </section>

        <section>
            <h2>{props.social_media_name} Visualizer</h2>
        </section>

    </div>
  )
}

export default Tiktok;
